import React from 'react';

function Menu({menu}) {
  return (
    <div>
        <h3>{menu.title}</h3>
        <ul>
            {menu.points.map(point => 
              <li>{point}</li>
              )}
        </ul>
    </div>
  )
}

export default Menu
